// Minimal simulator logic using BIG_COMMANDS
let serverIndex = 0, accountIndex = 0, stageIndex = 0;
const SERVER_COUNT = 50000;
const ACCOUNTS_PER_SERVER = 5;
const STEPS_PER_ACCOUNT = 200;

function genServerName(idx){ return 'Server_' + (idx+1) + '_host'; }
function getRequiredCommandForStage(serverIdx, accountIdx, stageIdx){
  const idx = Math.abs(((serverIdx * 7919) ^ (accountIdx * 4999) ^ (stageIdx * 9176))) % BIG_COMMANDS.length;
  return BIG_COMMANDS[idx];
}

document.getElementById('exec').addEventListener('click', async ()=>{
  const input = document.getElementById('cmd').value.trim();
  if(!input) return;
  log('> ' + input);
  await new Promise(r=>setTimeout(r, 100 + Math.random()*300));
  const required = getRequiredCommandForStage(serverIndex, accountIndex, stageIndex);
  if(input.toLowerCase() === required.toLowerCase() || required.toLowerCase().includes(input.toLowerCase())){
    log('Executed: ' + required);
    stageIndex++;
    if(stageIndex >= STEPS_PER_ACCOUNT){
      log('Account '+(accountIndex+1)+' on '+genServerName(serverIndex)+' hacked!');
      accountIndex++; stageIndex=0;
      if(accountIndex >= ACCOUNTS_PER_SERVER){
        log('Server '+genServerName(serverIndex)+' fully hacked. Moving to next.');
        serverIndex = Math.min(serverIndex+1, SERVER_COUNT-1);
        accountIndex=0;
      }
    } else {
      log('Progress: stage ' + stageIndex + '/' + STEPS_PER_ACCOUNT);
    }
  } else {
    const errs=['Access denied','Firewall triggered','Command failed','Insufficient privileges'];
    log('ERROR: ' + errs[Math.floor(Math.random()*errs.length)]);
  }
  document.getElementById('cmd').value='';
});

// dev helper to reveal the next required command
document.getElementById('reveal').addEventListener('click', ()=>{
  const next = getRequiredCommandForStage(serverIndex, accountIndex, stageIndex);
  log('(DEBUG) Next required: ' + next);
});

log('BIG_COMMANDS contains ' + BIG_COMMANDS.length + ' commands.');
log('Ready. Type a command and press Execute.');
